import React from 'react';
import AppHeader from "../AppHeader";
import SearchPanel from "../SearchPanel";
import TodoFilter from "../TodoFilter";
import TodoList from "../TodoList";
import {StyledApp, StyledSearchBar} from "./App.styled";


const TodoData = [
    {label: 'Learn React', important: false, id: 1},
    {label: 'Drink Coffee', important: false, id: 2},
    {label: 'Feed Cat', important: false, id: 3},
];

const onDelete = (id) => {
    let shallowCopy = [...TodoData];
    let res = shallowCopy.filter(el => el.id !==id);

    return {
        TodoData: res,
    }
};

const App = () => {

    return (
        <StyledApp>
            <AppHeader/>
            <StyledSearchBar>
                <SearchPanel/>
                <TodoFilter/>
            </StyledSearchBar>
            <TodoList data = {TodoData} onDelete = {(id) => onDelete(id)}/>
        </StyledApp>
    )
};

export default App;
